import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

import Header from './components/Header';
import Home from './pages/Home';
import CryptoTrend from './pages/CryptoTrend';
import VideoGen from './pages/VideoGen';
import ImageGen from './pages/ImageGen';
import Loading from './components/Loading';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gradient-to-br from-black via-gray-900 to-gray-800 text-gray-200 font-sans selection:bg-cyan-600 selection:text-white">
        <Header />
        <main className="p-6 max-w-7xl mx-auto">
          <React.Suspense fallback={<Loading />}>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/crypto-trend" element={<CryptoTrend />} />
              <Route path="/video-gen" element={<VideoGen />} />
              <Route path="/image-gen" element={<ImageGen />} />
              <Route path="*" element={<Navigate to="/" replace />} />
            </Routes>
          </React.Suspense>
        </main>
      </div>
    </Router>
  );
}

export default App;
